import { StyleSheet } from 'react-native';

const Style = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#233958',
        alignItems: 'center',
    },

    text: {
        color: '#fff',
        fontWeight: 'bold',
        fontSize: 55,
        marginTop: '40%'
    }
});

export default Style;
